import React, { Component } from 'react'
class HomePage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      items: {}
    };
  }
  fetchPosts() {
    // The API where we're fetching data from
    fetch(`https://s3-us-west-2.amazonaws.com/s.cdpn.io/3/posts.json`)
      // We get a response and receive the data in JSON format...
      .then(response => response.json())
      // ...then we update the state of our application
      .then(
        data =>
          this.setState({
            posts: data,
            isLoading: false,
          })
      )
      // If we catch errors instead of a response, let's update the app
      .catch(error => this.setState({ error, isLoading: false }));
  }
componentDidMount() {
  fetch(`http://192.168.1.107:8000/schools/teq`, {            
    method: 'GET',
})
 
  .then(res => res.json())
            .then(json => {
                this.setState({
                    items: json,
                    isLoaded: true, 
                })
            }).catch((err) => {
                console.log(err);
            });
          
          }


  render() {
    const { error, isLoaded, items } = this.state;
    if (error) {
      return <div>Error: {error.message}</div>;
    } else if (!isLoaded) {
      return <div>Loading...</div>;
    } else {
      return (
   
          
            <p >
              {items.name} 
            </p>
          
     
      );
    }
  }
}
export default HomePage
